import React from 'react';
import { motion } from 'framer-motion';
import '../styles/AnimatedBackground.css';

const AnimatedBackground = ({ colors }) => {
  // Use default colors if none provided or if colors array is too small
  const backgroundColors = colors && colors.length >= 5 
    ? colors 
    : ['#355c7d', '#6c5b7b', '#c06c84', '#f67280', '#f8b195', '#3f51b5', '#7e57c2', '#4caf50']; // Fallback to a nice gradient palette with 8 colors

  return (
    <div className="animated-background">
      {/* Extra large background blobs - covers most of the screen */}
      {[...Array(3)].map((_, i) => (
        <motion.div
          key={`xlarge-circle-${i}`}
          className="gradient-circle xlarge-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[i % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${10 + (i * 30)}%`, 
            left: `${5 + (i * 30)}%`, 
            width: '140vw', // Much bigger for more coverage
            height: '140vh',
            opacity: 0.7,
            position: 'absolute'
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1,
          }}
          animate={{
            x: [0, 120, -120, 40, -40, 0], // More extreme movement
            y: [0, -90, 90, -30, 30, 0],   // More extreme movement
            scale: [1, 1.2, 0.9, 1.15, 0.85, 1], // More extreme scaling
          }}
          transition={{
            duration: 25,              // Slower for more gentle movement
            ease: "easeInOut",         
            repeat: Infinity,
            repeatType: "mirror",      
            times: [0, 0.2, 0.4, 0.6, 0.8, 1] 
          }}
        />
      ))}

      {/* Large primary blobs - with varied positions */}
      {[...Array(4)].map((_, i) => (
        <motion.div
          key={`circle-${i}`}
          className="gradient-circle large-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 3) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${-10 + (i * 35)}%`, // Some positioned partly off-screen
            left: `${-20 + (i * 40)}%`, // Some positioned partly off-screen
            width: '130vw', // Even bigger
            height: '130vh',
            opacity: 0.65,
            position: 'absolute'
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1,
          }}
          animate={{
            x: [0, 150, -150, 50, -50, 0], // More movement
            y: [0, -100, 100, -40, 40, 0],   
            scale: [1, 1.15, 0.95, 1.1, 0.9, 1], 
          }}
          transition={{
            duration: 20,             
            ease: "easeInOut",         
            repeat: Infinity,
            repeatType: "mirror",      
            times: [0, 0.2, 0.4, 0.6, 0.8, 1],
            delay: i * 0.8 // Offset for more varied movement
          }}
        />
      ))}

      {/* Medium sized blobs with different positions */}
      {[...Array(5)].map((_, i) => (
        <motion.div
          key={`medium-circle-${i}`}
          className="gradient-circle medium-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 2) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${20 + (i * 20)}%`,
            left: `${70 - (i * 30)}%`, // Spread across horizontally
            width: '100vw',
            height: '100vh',
            opacity: 0.6,
            position: 'absolute'
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1
          }}
          animate={{
            x: [0, -110, 110, -40, 40, 0],       
            y: [0, 70, -70, 25, -25, 0],        
            scale: [0.9, 1.15, 0.85, 1.05, 0.9, 1], 
          }}
          transition={{
            duration: 18,              
            ease: "easeInOut",
            repeat: Infinity,
            repeatType: "mirror",
            times: [0, 0.2, 0.4, 0.6, 0.8, 1],
            delay: i * 1.2             
          }}
        />
      ))}

      {/* Small faster moving accent blobs */}
      {[...Array(4)].map((_, i) => (
        <motion.div
          key={`small-circle-${i}`}
          className="gradient-circle small-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 1) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${60 - (i * 20)}%`,
            left: `${20 + (i * 25)}%`,
            width: '80vw', 
            height: '80vh',
            opacity: 0.75,
            position: 'absolute'
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 10
          }}
          animate={{
            x: [0, 80, -80, 30, -30, 0], 
            y: [0, -60, 60, -20, 20, 0], 
            scale: [1, 1.1, 0.9, 1.05, 0.95, 1], 
          }}
          transition={{
            duration: 15,              
            ease: "easeInOut",
            repeat: Infinity,
            repeatType: "mirror",
            times: [0, 0.2, 0.4, 0.6, 0.8, 1],
            delay: i * 0.6          
          }}
        />
      ))}

      {/* Small rapid-moving blobs for extra dynamics */}
      {[...Array(4)].map((_, i) => (
        <motion.div
          key={`tiny-circle-${i}`}
          className="gradient-circle tiny-circle"
          style={{
            background: `radial-gradient(circle at center, ${backgroundColors[(i + 5) % backgroundColors.length]} 0%, transparent 70%)`,
            top: `${40 + (i * 15)}%`,
            left: `${50 - (i * 15)}%`,
            width: '60vw',
            height: '60vh',
            opacity: 0.6,
            position: 'absolute'
          }}
          initial={{ 
            x: 0, 
            y: 0, 
            scale: 1
          }}
          animate={{
            x: [0, 60, -60, 20, -20, 0],
            y: [0, -50, 50, -15, 15, 0],
            scale: [0.95, 1.05, 0.9, 1, 0.85, 0.95],
          }}
          transition={{
            duration: 12, // Faster movement
            ease: "easeInOut",
            repeat: Infinity,
            repeatType: "mirror",
            times: [0, 0.2, 0.4, 0.6, 0.8, 1],
            delay: i * 0.3 // Less delay for more active movement
          }}
        />
      ))}

      {/* Very subtle overlay for contrast */}
      <div className="background-overlay" />
    </div>
  );
};

export default React.memo(AnimatedBackground); // Memoize to prevent unnecessary re-renders
